int queue1_c = 0;
int queue2_c = 0;

void classifier(int length, double relative_time, int packet_threshold,
                pre_enq working_queue1[MAX_PACKETS], pre_enq working_queue2[MAX_PACKETS],
                int max_size_queue1, int max_size_queue2) {
    

    #pragma HLS INLINE off

    pre_enq packet_meta = {length, relative_time};

    if(length <= packet_threshold) {
        working_queue1[queue1_c] = packet_meta;
        queue1_c+=1;

    } else {
        working_queue2[queue2_c] = packet_meta;
        queue2_c+=1;
    }
}

double get_back_double_hw(const ap_uint<256>word){

	ap_uint<64>ret_time_bits = word.range(95,32);
	// Convert back to double value
	double ret_time;
	memcpy(&ret_time, &ret_time_bits, sizeof(double));
//	std::cout<<ret_time<<endl;
	return ret_time;
}

void build_pre_enq(Packet central_queue[DATA_SIZE], pre_enq pre[DATA_SIZE], int packet_threshold,pre_enq working_queue1[MAX_PACKETS], pre_enq working_queue2[MAX_PACKETS],  int max_queue_size1, int max_queue_size2){

    #pragma HLS INLINE off

    for(int i=0; i<DATA_SIZE; i++){
	   #pragma HLS LOOP_TRIPCOUNT min=1 max=DATA_SIZE
       #pragma HLS PIPELINE
        Packet pt = central_queue[i];
        // std::cout<<"Hello"<<endl;
        pre[i] = {pt.length, pt.relative_time};

        classifier(pt.length, pt.relative_time, packet_threshold, working_queue1, working_queue2, max_queue_size1, max_queue_size2);
    }    
}

void sim_FlexMesh(hls::stream<axis_data>&input, hls::stream<axis_data>&output){

	#pragma HLS INTERFACE axis register both port=input
	#pragma HLS INTERFACE ap_ctrl_none port=return
	#pragma HLS INTERFACE axis register both port=output

	axis_data local_read, local_write;
    
    // Input variables
    int length=0;
    double relative_time = 0.0;
    int packet_id = 0;
    int flow_id = 0;
    double processing_time = 0.0;
    ap_uint<64>relative_time_bits;

    for(int i=0; i<DATA_SIZE; i++){
        local_read = input.read();
        ap_uint<256>word;
        word = local_read.data; // 256 bit word
        
        // Read the inputs from the input stream
        length = word.range(31,0);
        relative_time_bits = word.range(95,32); // relative time bits
        packet_id = word.range(127, 96);
        flow_id = word.range(159, 128);

        // Convert relative time bits to double value
        relative_time = get_back_double_hw(word);

        central_queue[central_queue_size++] = {length, relative_time, packet_id, flow_id};
        
    }

    // Calling classifier function
    int packet_threshold = 256;
    int max_queue_size1 = MAX_PACKETS;
    int max_queue_size2 = MAX_PACKETS;

    build_pre_enq(central_queue, pre, packet_threshold, working_queue1, working_queue2,  max_queue_size1, max_queue_size2);

    for(int i=0; i<queue1_c; i++){
        pre_enq pt = working_queue1[i];
        ap_uint<64>proc_time_bits;

        // Packet fields
        int length = pt.length;
        double relative_time = pt.relative_time;

        // Output from the program 
        ap_uint<256>word;
        word.range(31,0) = length;
        // Convert relative time to bits format again to send
        ap_uint<64>ret_time_bits;
        memcpy(&ret_time_bits, &relative_time, sizeof(double));
        word.range(95,32) = ret_time_bits;

        local_write.data = word;
        if(queue1_c == (i+1)){
            local_write.last = 1;
        }else{
            local_write.last = 0;
        }

        output.write(local_write);

    }

}
